import { FC } from 'react'
import styled from 'styled-components'
interface IStyle {
    bgColor?: string,
    width?: number,
}
const style:  FC<IStyle> = ({bgColor, width}) => Button.css.button`
    background: ${bgColor};
    width: ${width}px;
`

export default style
